// src/components/Navbar.jsx
import { useState } from "react";
import { NavLink } from "react-router-dom";
import { motion, AnimatePresence } from "framer-motion";
import { FiMenu, FiX, FiShoppingCart } from "react-icons/fi";
import { useCart } from "../context/CartContext";

export default function Navbar() {
    const [menuOpen, setMenuOpen] = useState(false);
    const { cart } = useCart();

    const navLinks = [
        { path: "/", label: "ÿßŸÑÿ±ÿ¶Ÿäÿ≥Ÿäÿ©" },
        { path: "/category", label: "ÿßŸÑŸÉÿ™ÿ®" },
        { path: "/cart", label: "ÿ≥ŸÑÿ© ÿßŸÑÿ™ÿ≥ŸàŸÇ" },
        { path: "/contact", label: "ÿ™ŸàÿßÿµŸÑ ŸÖÿπŸÜÿß" },
    ];

    const container = {
        hidden: { opacity: 0, y: -20 },
        show: {
            opacity: 1,
            y: 0,
            transition: { staggerChildren: 0.12, duration: 0.5 },
        },
    };

    const item = {
        hidden: { opacity: 0, y: -10 },
        show: { opacity: 1, y: 0, transition: { duration: 0.4 } },
    };

    return (
        <motion.nav
            initial="hidden"
            animate="show"
            variants={container}
            className="sticky top-0 z-50 bg-white/80 backdrop-blur-md shadow-md border-b border-blue-100"
        >
            <div className="flex justify-between items-center px-6 py-4 md:flex-row">
                {/* üß≠ ÿ±Ÿàÿßÿ®ÿ∑ ÿßŸÑÿ™ŸÜŸÇŸÑ - ÿ™ÿ∏Ÿáÿ± ÿ£ŸàŸÑŸãÿß ŸÅŸä ÿßŸÑÿ¥ÿßÿ¥ÿßÿ™ ÿßŸÑŸÉÿ®Ÿäÿ±ÿ© */}
                <motion.div
                    className="hidden md:flex items-center gap-6 text-sm sm:text-base md:text-lg font-medium"
                    variants={container}
                >
                    {navLinks.map((link) => (
                        <motion.div key={link.path} variants={item}>
                            <NavLink
                                to={link.path}
                                className={({ isActive }) =>
                                    `px-3 py-1 rounded-lg transition-all duration-200 ${
                                        isActive
                                            ? "text-blue-700 font-semibold bg-blue-100"
                                            : "text-gray-700 hover:text-blue-600 hover:bg-gray-100"
                                    }`
                                }
                            >
                                {link.label}
                            </NavLink>
                        </motion.div>
                    ))}
                </motion.div>

                {/* ü™∂ ÿßŸÑÿ¥ÿπÿßÿ± - Ÿäÿµÿ®ÿ≠ ÿπŸÑŸâ ÿßŸÑŸäŸÖŸäŸÜ ŸÅŸä ÿßŸÑÿ¥ÿßÿ¥ÿßÿ™ ÿßŸÑŸÉÿ®Ÿäÿ±ÿ© */}
                <motion.div
                    variants={item}
                    className="ml-auto md:order-3 w-14 md:ml-auto"
                >
                    <NavLink to="/">
                        <img
                            src="/images/logo.png"
                            alt="ÿ¥ÿπÿßÿ± ÿßŸÑŸÖŸàŸÇÿπ"
                            className="rounded-full border border-gray-300 shadow-sm hover:scale-105 transition-transform duration-300"
                        />
                    </NavLink>
                </motion.div>

                {/* üõí ÿ£ŸäŸÇŸàŸÜÿ© ÿßŸÑÿ≥ŸÑÿ© + ÿ≤ÿ± ÿßŸÑŸÇÿßÿ¶ŸÖÿ© ŸÅŸä ÿßŸÑŸÖŸàÿ®ÿßŸäŸÑ */}
                <div className="flex items-center gap-6 md:hidden order-1">
                    <button
                        onClick={() => setMenuOpen(!menuOpen)}
                        className="text-3xl text-gray-700 hover:text-blue-700 transition"
                        aria-label="ŸÅÿ™ÿ≠ ÿßŸÑŸÇÿßÿ¶ŸÖÿ©"
                    >
                        {menuOpen ? <FiX /> : <FiMenu />}
                    </button>

                    <NavLink to="/cart" className="relative">
                        <FiShoppingCart className="text-3xl text-blue-700 hover:text-blue-600 transition" />
                        {cart.length > 0 && (
                            <span className="absolute -top-2 -right-2 bg-red-600 text-white text-xs w-5 h-5 flex items-center justify-center rounded-full shadow">
                                {cart.length}
                            </span>
                        )}
                    </NavLink>
                </div>
            </div>

            {/* üì± ŸÇÿßÿ¶ŸÖÿ© ÿßŸÑŸÖŸàÿ®ÿßŸäŸÑ ÿßŸÑŸÖŸÜÿ≥ÿØŸÑÿ© */}
            <AnimatePresence>
                {menuOpen && (
                    <motion.div
                        initial={{ opacity: 0, y: -10 }}
                        animate={{ opacity: 1, y: 0 }}
                        exit={{ opacity: 0, y: -10 }}
                        transition={{ duration: 0.3 }}
                        className="md:hidden bg-white shadow-inner px-6 py-4 space-y-3 border-t border-gray-200"
                    >
                        {navLinks.map((link) => (
                            <NavLink
                                key={link.path}
                                to={link.path}
                                onClick={() => setMenuOpen(false)}
                                className={({ isActive }) =>
                                    `block px-2 py-2 rounded-md ${
                                        isActive
                                            ? "bg-blue-100 text-blue-700 font-semibold"
                                            : "text-gray-700 hover:bg-gray-100 hover:text-blue-600"
                                    }`
                                }
                            >
                                {link.label}
                            </NavLink>
                        ))}
                    </motion.div>
                )}
            </AnimatePresence>
        </motion.nav>
    );
}
